    //     className="card-img-top"
    //   />
    //   <MDBCardBody className="card-body text-center">
    //     <MDBCardTitle>Login to see Bid Status</MDBCardTitle>
    //     <MDBBtn href="" className="btn btn-primary">
    //       VIEW THIS LOT
    //     </MDBBtn>
    //   </MDBCardBody>
    // </MDBCard>
    <div className="row">
  <div className="col-md-6">
    <MDBCard className="card ml-3 mt-5" style={{ width: "18rem" }}>
      <MDBCardImage
        src="https://online-auction.state.gov/Image/Get?id=8334df7d-dc13-4930-b532-98c0489145ba&size=2"
        position="top"
        alt="..."
        className="card-img-top"
      />
      <MDBCardBody className="card-body text-center">
        <MDBCardTitle>Login to see Bid Status</MDBCardTitle>
        <MDBBtn href="" className="btn btn-primary">
          VIEW THIS LOT
        </MDBBtn>
      </MDBCardBody>
    </MDBCard>
  </div>
  <div className="col-md-6">
    <div className="row">
      <div className="col-lg-9 col-md-8 col-sm-7 name-of-the-item">Printer - AG0233P AG0889D AG0960H AG1068J AG1097G</div>
      <div className="col-lg-3 col-md-4 col-sm-5">
        <div className="">
          <div className="oa-generic-status-indicator" style={{backgroundColor: '#73a839'}}>
            <i className="fa fa-legal fa-18"></i>&nbsp; Active
          </div>
        </div>
      </div>
    </div>
  </div>
</div>
  );
}
